    // Check if the transaction was successful
    if (txReceipt.status !== 1) {
      throw new Error('Transaction failed');
    }

    // Return the transaction hash or any other relevant information
    return txReceipt.transactionHash;
  } catch (e) {
    console.log(e);
  }
}

