	std::cout << "Current Frame: " << currentFrame << " | Cmd Buffer Index: " << currentCmdBufferIndex << " | Image Index: " << imageIndex << "\n";
	std::cout << "Calling vkBeginCommandBuffer…\n";
	vkBeginCommandBuffer(currentCommandBuffer, &beginInfo);
