		this.setPixelBufPosition(0);
		for (int i = 0; i < this.pixels.length; i++) {
			int colour = this.pixels[i];
			int height = (colour >> 24) & 0xff;
			int alpha = (y >= height) ? 255 - ((y - height) * 8) : 0;
			if (alpha < 0) {
				alpha = 0;
			}
			this.pixelBufPut(((alpha << 24) & 0xff000000) | (colour & 0xffffff));
		}
		this.updateTexture();
