		this.updateZ = (this.pz >> 4) - 1;

		this.processBlock(
				this.px - (this.updateX << 4),
				this.py,
				this.pz - (this.updateZ << 4)
		);

		int cxMax = this.updateX + 2;
		int czMax = this.updateZ + 2;
		WorldClient world = this.mw.mc.theWorld;
		int flagOffset = 0;
		for (int cz = this.updateZ; cz <= czMax; cz++) {
