            int blockid = Block.blockRegistry.getIDForObject(block);
			int meta = this.chunk.getBlockMetadata(x, y, z);
			return ((blockid & 0xfff) << 4) | (meta & 0xf);
		}

		@Override
		public int getBiome(int x, int z) {
